import React, {Component} from "react";
import './Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import home from './homepage.jpg';
import windmill from './Photos/Windmills.jpeg';
import './Home.css';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu, Media,
    DropdownItem } from 'reactstrap';
    
export class Home extends Component {
    constructor(props) {
      super(props);
    }
    render() {
    //Photo by American Public Power Association on Unsplash
      return (
        <div className="Home" >
            <container style={{
                height: "50%"
                }}>
                <center><h3 style={{fontSize: '50px'}}>Empowering Knowledge</h3></center>
                <div className="text">
                    <p style={{textAlign: 'center', fontSize: '20px', paddingTop: '2%'}}>Do you know where your energy is coming from? Do you know who is making those decisions?</p>
                </div>
                <img style={{
                    flex: 1,
                    alignSelf: 'stretch',
                    width: "100%",
                    //height: "100%"
                    }}
                src={windmill}     
                />
            </container>
        </div>
        
      );
    }
}

export default Home;
